Ingredientes:
Massa
- ½ xícara (chá) de farinha de trigo;
- 1 colher (café) de sal;
- ¾ xícara (chá) de leite;
- 1 colher (sopa) de manteiga derretida;
- 2 ovos;
- Óleo de soja para fritar.

Calda
- 2 xícaras (chá) de suco de laranja;
- 1 xícara (chá) de açúcar;
- Raspas de laranja;
- 1 cálice de licor de curaçau ou licor de laranja.

Modo de preparo:
Massa
Coloque no liquidificador Fischer o leite, a farinha de trigo, os ovos, a manteiga e o sal, bata até obter uma massa lisa e homogênea. Despeje a massa numa tigela, cubra e deixe repousar na geladeira por pelo menos 20 minutos antes de utilizar. No cooktop Fischer unte com manteiga uma frigideira, adicione uma concha de massa, virando a frigideira rapidamente para espalhar. Quando as bordas começarem a dourar, vire o crepe do outro lado. Dobre cada um dos crepes em 4, dando um formato de leque.

Calda
Leve ao cooktop Fischer uma frigideira grande, coloque o suco de laranja e o açúcar. Deixe ferver até reduzir pela metade, acrescente as raspas de laranja.
Disponha os crepes dobrados na frigideira com a calda e deixe ferver por 2 minutos e acrescente o licor de laranja.

Dica
Se preferir flambar, coloque o licor de curaçau, deixe ferver e flambe imediatamente, acendendo um fósforo ou inclinando ligeiramente a frigideira para que a chama do fogão se aproxime.


